import React, { Component } from "react";
import { connect } from "react-redux";

import {
  NavbarLeftStyle,
  NavbarTopStyle,
  LogoContainer
} from "../../assets/components/layout/Navbar.style";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      active: true
    };
  }

  showMenu() {
    this.setState({
      active: !this.state.active
    });
  }

  render() {
    return <div />;
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
